import React, {Component} from 'react';
import './layout.css';

class Header extends Component{
  render(){
    return(
        <header class="MuiPaper-root MuiAppBar-root MuiAppBar-positionAbsolute jss315 jss316 MuiAppBar-colorPrimary MuiPaper-elevation4">
            <div class="MuiToolbar-root MuiToolbar-regular jss313 MuiToolbar-gutters">
                <button class="MuiButtonBase-root MuiIconButton-root jss317 jss318 MuiIconButton-colorInherit MuiIconButton-edgeStart" tabindex="0" type="button" aria-label="open drawer">
                    <span class="MuiIconButton-label">
                    <svg class="MuiSvgIcon-root" focusable="false" viewBox="0 0 24 24" aria-hidden="true" role="presentation">
                    <path d="M3 18h18v-2H3v2zm0-5h18v-2H3v2zm0-7v2h18V6H3z"></path></svg></span>
                    <span class="MuiTouchRipple-root"></span>
                </button>
                <h1 class="MuiTypography-root jss319 MuiTypography-h6 MuiTypography-colorInherit MuiTypography-noWrap">Dashboard</h1>
                <button class="MuiButtonBase-root MuiIconButton-root MuiIconButton-colorInherit" tabindex="0" type="button">
                    <span class="MuiIconButton-label">
                    <span class="MuiBadge-root">
                    <svg class="MuiSvgIcon-root" focusable="false" viewBox="0 0 24 24" aria-hidden="true" role="presentation">
                    <path d="M12 22c1.1 0 2-.9 2-2h-4c0 1.1.89 2 2 2zm6-6v-5c0-3.07-1.64-5.64-4.5-6.32V4c0-.83-.67-1.5-1.5-1.5s-1.5.67-1.5 1.5v.68C7.63 5.36 6 7.92 6 11v5l-2 2v1h16v-1l-2-2z"></path></svg>
                    <span class="MuiBadge-badge MuiBadge-anchorOriginTopRightRectangle MuiBadge-colorSecondary">4</span></span></span>
                    <span class="MuiTouchRipple-root"></span>
                </button>
            </div>
        </header>
    );
  }
}

export default Header;
